}

check_platform(){
   platform=$(uname -m)
   if [[ ! ${platform} =~ 'aarch64' ]] && [[ ! ${platform} =~ 'armv7l' ]]; then
      echo ELT_RTKBase cannot be installed on ${platform} architecture
      exit 1
   fi
}

